definition.precondition:
- the hoist, the crate and the surface must be at the same place;
- the crate must be clear;
- the crate must be on the surface;
- the hoist must be available.

definition.postcondition:
- the hoist is lifting the crate;
- the surface is clear;
- the fuel cost is increased.

definition.precondition:
- the hoist, the crate and the surface must be at the same place;
- the hoist must be holding the crate;
- the surface must be clear.

- the hoist, the crate and the truck must be at the same place;
- the hoist must be holding the crate;
- the truck must support the crate weight added to its current load.

definition.postcondition:
- the crate is in the truck;
- the hoist is available;
- the truck has its load increased by the crate weight.

definition.precondition:
- the hoist, the crate and the truck must be at the same place;
- the crate must be in the truck;
- the hoist must be available.

definition.postcondition:
- the hoist is holding the crate;
- the crate is at the place;
- the truck has its current load weight decreased;
- the fuel cost is increased.
